import React, { useCallback,useEffect, useState, createRef, memo } from 'react'

const InputBoxChilde = ({clickedValues})=>{

    const [values, setValues] = useState(''); 

    useEffect(()=>{
        setValues(''); 
    },[clickedValues.length])
    const onChages = (e)=>{
        setValues(e.target.value); 
    }
    return (
        <input type="text" value={values} onChange={onChages} />
    )
}

export default InputBoxChilde;
